
import { useState, useEffect } from 'react';
import { useTickets } from '@/hooks/useTickets';
import { useEvents } from '@/hooks/useEvents';
import { Button } from '@/components/ui/button';
import {
  Card,
  CardContent,
  CardDescription,
  CardHeader,
  CardTitle,
} from '@/components/ui/card';
import { Input } from '@/components/ui/input';
import { QrCode, CheckCircle, XCircle, Search, Loader2, Camera, User, Clock } from 'lucide-react';
import { toast } from '@/components/ui/sonner';
import { QrScanner } from '@yudiel/react-qr-scanner';
import { Badge } from '@/components/ui/badge';

interface CheckInScannerProps {
  eventId: string;
}

interface QRData {
  ticketId: string;
  eventId: string;
  ownerId: string;
  status: string;
  purchaseDate: string;
}

interface ScanResult {
  success: boolean;
  message: string;
  ticketData?: any;
}

const CheckInScanner = ({ eventId }: CheckInScannerProps) => {
  const [isScanning, setIsScanning] = useState(false);
  const [ticketId, setTicketId] = useState('');
  const [scanResult, setScanResult] = useState<ScanResult | null>(null);
  const [isProcessing, setIsProcessing] = useState(false);
  const [recentCheckIns, setRecentCheckIns] = useState<any[]>([]);
  
  const { checkInTicketMutation } = useTickets();
  const { useEventQuery } = useEvents();
  
  const { data: event } = useEventQuery(eventId);
  
  const handleQRScan = async (result: string) => {
    console.log('QR Code scanned:', result);
    
    try {
      // Parse the QR code data
      const qrData: QRData = JSON.parse(result);
      
      // Validate that this QR code is for the correct event
      if (qrData.eventId !== eventId) {
        setScanResult({
          success: false,
          message: 'This ticket is not for this event'
        });
        setIsScanning(false);
        return;
      }
      
      // Check in the ticket
      await checkInTicket(qrData.ticketId);
      setIsScanning(false);
      
    } catch (error) {
      console.error('Error parsing QR code:', error);
      setScanResult({
        success: false,
        message: 'Invalid QR code format'
      });
      setIsScanning(false);
    }
  };
  
  const handleQRError = (error: any) => {
    console.error('QR Scanner error:', error);
    toast('Error accessing camera. Please check permissions.');
    setIsScanning(false);
  };
  
  const startScanning = () => {
    setIsScanning(true);
    setScanResult(null);
  };
  
  const stopScanning = () => {
    setIsScanning(false);
  };
  
  const checkInTicket = async (ticketIdToCheck?: string) => {
    const targetTicketId = ticketIdToCheck || ticketId;
    
    if (!targetTicketId) {
      toast('Please enter a ticket ID or scan a QR code');
      return;
    }
    
    setIsProcessing(true);
    setScanResult(null);
    
    try {
      const checkedInTicket = await checkInTicketMutation.mutateAsync(targetTicketId);
      
      setScanResult({
        success: true,
        message: 'Ticket checked in successfully!',
        ticketData: checkedInTicket
      });
      
      // Add to recent check-ins
      setRecentCheckIns(prev => [
        {
          id: checkedInTicket.id,
          checked_in_at: new Date().toISOString(),
          metadata: checkedInTicket.metadata
        },
        ...prev.slice(0, 4) // Keep only last 5 check-ins
      ]);
      
      // Clear the ticket ID field
      setTicketId('');
      
      // Play success sound (optional)
      try {
        const audio = new Audio('data:audio/wav;base64,');
        audio.play().catch(() => {});
      } catch (e) {}
      
    } catch (error: any) {
      console.error('Error checking in ticket:', error);
      
      setScanResult({
        success: false,
        message: error.message || 'Failed to check in ticket'
      });
    } finally {
      setIsProcessing(false);
    }
  };

  return (
    <Card className="glass-card border-none">
      <CardHeader>
        <CardTitle className="flex items-center gap-2">
          <Camera className="h-5 w-5" />
          Ticket Check-In Scanner
        </CardTitle>
        <CardDescription>
          Scan QR codes or enter ticket IDs to check in attendees for {event?.title}
        </CardDescription>
      </CardHeader>
      
      <CardContent>
        <div className="space-y-6">
          {/* QR Scanner */}
          <div className="flex flex-col items-center">
            <div className="w-full max-w-md">
              {isScanning ? (
                <div className="relative">
                  <QrScanner
                    onDecode={handleQRScan}
                    onError={handleQRError}
                    constraints={{
                      width: 400,
                      height: 400,
                      aspectRatio: 1,
                      facingMode: 'environment'
                    }}
                    ViewFinder={() => (
                      <div className="absolute inset-0 border-2 border-blue-500 rounded-lg flex items-center justify-center">
                        <div className="w-48 h-48 border-2 border-white rounded-lg opacity-50" />
                      </div>
                    )}
                  />
                  <div className="absolute top-2 right-2">
                    <Button variant="outline" size="sm" onClick={stopScanning}>
                      Stop Scanning
                    </Button>
                  </div>
                </div>
              ) : (
                <div className="w-full h-64 border-2 border-dashed border-border rounded-lg flex flex-col items-center justify-center gap-4">
                  {scanResult ? (
                    scanResult.success ? (
                      <>
                        <CheckCircle className="h-16 w-16 text-green-500" />
                        <p className="text-green-600 font-medium text-center">{scanResult.message}</p>
                        {scanResult.ticketData && (
                          <div className="text-sm text-center text-muted-foreground">
                            <p>Ticket ID: {scanResult.ticketData.id.substring(0, 8)}...</p>
                            <p>Type: {scanResult.ticketData.metadata?.ticketType || 'General'}</p>
                          </div>
                        )}
                      </>
                    ) : (
                      <>
                        <XCircle className="h-16 w-16 text-red-500" />
                        <p className="text-red-600 font-medium text-center">{scanResult.message}</p>
                      </>
                    )
                  ) : (
                    <>
                      <QrCode className="h-16 w-16 text-muted-foreground" />
                      <p className="text-muted-foreground text-center">Point camera at QR code to scan</p>
                    </>
                  )}
                  
                  <Button 
                    onClick={startScanning} 
                    disabled={isProcessing}
                    className="bg-blue-600 hover:bg-blue-700"
                  >
                    <Camera className="h-4 w-4 mr-2" />
                    Start Camera Scan
                  </Button>
                </div>
              )}
            </div>
          </div>
          
          {/* Manual Entry */}
          <div className="space-y-3">
            <h3 className="text-sm font-medium flex items-center gap-2">
              <Search className="h-4 w-4" />
              Manual Ticket Entry
            </h3>
            <div className="flex gap-2">
              <Input
                placeholder="Enter ticket ID manually"
                value={ticketId}
                onChange={(e) => setTicketId(e.target.value)}
                disabled={isProcessing || isScanning}
                className="flex-1"
              />
              <Button 
                onClick={() => checkInTicket()} 
                disabled={!ticketId || isProcessing || isScanning}
                variant="outline"
              >
                {isProcessing ? (
                  <Loader2 className="h-4 w-4 animate-spin" />
                ) : (
                  <Search className="h-4 w-4" />
                )}
              </Button>
            </div>
          </div>

          {/* Recent Check-ins */}
          {recentCheckIns.length > 0 && (
            <div className="space-y-3">
              <h3 className="text-sm font-medium flex items-center gap-2">
                <Clock className="h-4 w-4" />
                Recent Check-ins
              </h3>
              <div className="space-y-2">
                {recentCheckIns.map((checkIn) => (
                  <div key={checkIn.id} className="flex items-center justify-between p-3 bg-green-50 border border-green-200 rounded-lg">
                    <div className="flex items-center gap-2">
                      <CheckCircle className="h-4 w-4 text-green-500" />
                      <span className="text-sm font-medium">
                        {checkIn.metadata?.ticketType || 'General'} Ticket
                      </span>
                    </div>
                    <div className="text-xs text-muted-foreground">
                      {new Date(checkIn.checked_in_at).toLocaleTimeString()}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          )}
        </div>
      </CardContent>
      
      <CardFooter className="flex flex-col gap-3 border-t border-border pt-4">
        <div className="flex justify-between items-center w-full text-sm text-muted-foreground">
          <span className="flex items-center gap-1">
            <User className="h-4 w-4" />
            Total Attendees: {event?.tickets_sold || 0}
          </span>
          <span className="flex items-center gap-1">
            <Ticket className="h-4 w-4" />
            Capacity: {event?.total_tickets || 0}
          </span>
        </div>
        
        {event?.tickets_sold && event?.total_tickets && (
          <div className="w-full bg-gray-200 rounded-full h-2">
            <div 
              className="bg-blue-600 h-2 rounded-full transition-all duration-300" 
              style={{ 
                width: `${Math.min((event.tickets_sold / event.total_tickets) * 100, 100)}%` 
              }}
            />
          </div>
        )}
      </CardFooter>
    </Card>
  );
};

export default CheckInScanner;
